import StickyFooter from 'react-sticky-footer';
const Footer = () =>{
    return(
        <StickyFooter bottomThreshold={50} normalStyles={{backgroundColor: "#999999",padding: "2rem"}}
        stickyStyles={{backgroundColor: "rgba(255,255,255,.8)",padding: "2rem",width:"100%"}}>
            <nav className="navbar navbar-expand-lg navbar-light bg-light">
                <div className="row">
                    <div>
                        <label>ajith</label>
                    </div>
                    <div>
                        <label>ajith</label>
                    </div>
                    <div>
                        <label>ajith</label>
                    </div>
                </div>
            </nav>
        </StickyFooter>
    );
}
export default Footer;
